import { Label } from "@mui/icons-material";
import { Button, TextField, Typography } from "@mui/material";
import { useState } from "react";
import shiftsUtils from "../Utils/shiftsUtils";

const ShiftComp = (props) => {
  let token = sessionStorage["token"];
  const [date, setDate] = useState(props.shift.Date);
  const [startH, setStartH] = useState(props.shift.StartingHour);
  const [endingH, setEndingH] = useState(props.shift.EndingHour);

  const update_shift = async () => {
    let obj = {};
    obj.Date = date;
    obj.StartingHour = startH;
    obj.EndingHour = endingH;
    obj._id = props.shift._id;
    await shiftsUtils.update_shift(token, props.shift._id, obj);
  };

  return (
    <div>
      <Typography variant="body2" mt={1} mb={2} color="primary">
        <b> id: {props.shift._id}</b>
      </Typography>
      {/* <br /> <br /> */}
      <TextField
        id="outlined-basic"
        placeholder="26/02/22"
        label="Date"
        variant="outlined"
        fullWidth
        value={date}
        onChange={(e) => setDate(e.target.value)}
        sx={{ mb: 1 }}
        // error={LastNameError}
      />
      <br />
      <TextField
        id="outlined-basic"
        placeholder="09:00"
        label="Starting hour"
        variant="outlined"
        fullWidth
        value={startH}
        onChange={(e) => setStartH(e.target.value)}
        sx={{ mb: 1 }}
        // error={LastNameError}
      />
      <br />
      <TextField
        id="outlined-basic"
        placeholder="19:00"
        label="Ending hour"
        variant="outlined"
        fullWidth
        value={endingH}
        onChange={(e) => setEndingH(e.target.value)}
        sx={{ mb: 1 }}
        // error={LastNameError}
      />
      <br />
      <Button
        fullWidth
        sx={{ mb: 1 }}
        variant="contained"
        onClick={update_shift}
      >
        UPDATE
      </Button>
    </div>
  );
};

export default ShiftComp;
